    false,nt"url": null,nt"notes": "This annual narrative report for Tewaukon
    WMD outlines Refuge accomplishments during the 1969 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, fish,
    and reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and vegetation control.
    Resource management is outlined; topics include grazing. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. N-R forms and photographs are attached.",nt"owner_org":
